@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("ndss.nl") {

 .headerbar {
background-color: #A3562C;
	 background: #A3562C !important;
	margin-bottom: 4px !important;
	padding: 0 5px !important;
	height: 108px !important;
}

img[src*="/static/header.png"] {
background: url(data:image/png;base64,); 
background-repeat: no-repeat !important;
 width: 0 !important;
 padding-left: 240px !important;
 padding-top: 30px !important;
}

hr {background-color: #000000 !important; color: #000000 !important;}


.headerbar a {color: #4D4D4D !important;
}

/* LAATSTE RELEASES EN ALLES */
[width="4"] + TD[valign="top"] > DIV.panel + BR[style="clear: both;"] + SCRIPT[type="text/javascript"] + * {display: none !important;}

/* SPONSORBLOK BOVEN RELEASES */
[width="180"] + *[width="4"] + *[valign="top"] > DIV.panel:first-child {display: none !important;}

/* SPONSOR ACEKARD */
[style="clear: both;"] + *.panel + *[style="clear: both;"] + *.panel + *[style="clear: both;"] + DIV.panel {display: none !important;}

/* LINKS BLOK */
DIV.panel + BR[style="clear: both;"] + STYLE[type="text/css"] + DIV.panel {display: none !important;}

/* BR RUIMTE TUSSEN RELASE EN HEADER */
DIV + BR[style="clear: both;"] + td + DIV.panel + DIV.inner {display: none !important;}

#release_info {
width: 0px !important;
}

.forabg {
background-image: url(data:image/gif;base64,) !important; 
}

.forumbg {
background-image: url(data:image/gif;base64,) !important; 
}

DIV.post.bg2 {background-color: #BA6536 !important;}
DIV.post.bg1 {background-color: #9C522A !important;}
DIV#postingbox {background-color: #BA6536 !important;}
DIV.panel{background-color: #9C522A !important; color: inherit !important;}


TABLE.release_list {background-color: #BA6536 !important}
*.release_list *[bgcolor="#e8e8e8"] > TD {background-color: #BA6536 !important}
*#release_list *[bgcolor="#f0f0f0"] > TD {background-color: #9C522A !important;}
*[width="4"] + TD[width="180"] > *.panel + * + *.panel > DIV.inner a {color: inherit !important;}
DIV.navbar {background-color: #BA6536 !important;}
body { background-color: black !important;}
*[style="float: left;"] + SPAN[style="float: right; padding-right: 10px;"] + * + SMALL {color: inherit !important;}
*[width="180"][style="padding-left: 6px;"] > *.panel + * + DIV.panel > DIV.inner {color: inherit !important;}
H4.first > A > STRONG {color: #000000 !important;}
TBODY > TR > TD[width="180"][valign="top"][style="padding-right: 6px;"] {color: #000000 !important;}
.navbar {color: #000000 !important;}
*.icon-ucp > A {color:#FFFFFF !important;}
*.linklist.navlinks A{color:#FFFFFF !important;}
*.panel > DIV.inner {color: #000000 !important;}
UL.linklist.rightside A {color:#FFFFFF !important;}
*[width="180"][style="padding-right: 6px;"] > DIV.panel a {color: #000000 !important;}
DIV.inner > SPAN.corners-top + H3{color: #000000 !important;}
DIV.postbody > H3 A {color: #000000 !important;}
DL.postprofile DD {color: #858585 !important;}
DL.postprofile DD strong {color: #000000 !important;}
DIV.postbody > DIV.content {color: #000000 !important;}
DIV#page-body > H2 > A {color: #666666 !important;}
DL.postprofile A + BR {color: #000000 !important;}
A.username-coloured[style="color: rgb(99, 162, 34);"] {color: rgb(99, 162, 34);}
A.username-coloured[style="color: rgb(69, 109, 169);"] {color: rgb(69, 109, 169);}
HR[width="90%"] + * + * + * + SPAN[style="float: left;"] + * + * + * + SPAN[style="float: right; padding-right: 10px;"] + * + SMALL {color: inherit !important;}
}
